import React from "react";
function NewsArticle(props) {
  return (
    <div className="news">
      <a href={props.urlToImage}>
        <div className="news__image">
          <img
            src={props.urlToImage}
            atl={props.displayimage}
            width="350"
            height="200"
          />
        </div>
      </a>
      <br />
      <h3 className="news__title">{props.title}</h3>
      <p className="news__desc">
        {props.description}{" "}
        <span className="news__url">
          {" "}
          {"\u00A0"}{" "}
          <a href={props.url} target="_blank" rel="noopener noreferrer">
            {" "}
            Read More..{" "}
          </a>{" "}
        </span>
      </p>
      <span className="news__author">
        Author: {"\u00A0"} {"\u00A0"} {props.author}
      </span>{" "}
      <br />
      <span className="news__published">
        Date Pub: {"\u00A0"} {props.publishedAt}
      </span>{" "}
      <br />
      <span className="news__source">
        Source: {"\u00A0"} {"\u00A0"} {"\u00A0"} {props.source.name}
      </span>{" "}
      <br />
    </div>
  );
}

export default NewsArticle;
